 <details class=&quot;group rounded-2xl shadow-sm [&amp;amp;_summary::-webkit-details-marker]:hidden open:ring-1 open:ring-emerald-500/20 bg-white&quot;>
 <summary class=&quot;flex cursor-pointer items-center justify-between gap-1.5 p-6 text-slate-900&quot;>
 <h2 class=&quot;text-lg font-semibold&quot;>Do you accept dental insurance?</h2>
 <div class=&quot;rounded-full p-1.5 text-emerald-500 transition duration-300 group-open:-rotate-180 bg-emerald-50&quot;>
 <svg xmlns=http://www.w3.org/2000/svg width=24 height=24 viewBox=&quot;0 0 24 24&quot; fill=none stroke=currentColor stroke-width=2 stroke-linecap=round stroke-linejoin=round data-lucide=chevron-down class=&quot;lucide lucide-chevron-down w-5 h-5&quot;><path d=&quot;m6 9 6 6 6-6&quot;></path></svg>
 </div>
 </summary>
 <p class=&quot;px-6 pb-6 text-slate-500 leading-relaxed font-medium&quot;>
 Yes, we accept most major dental insurance plans. Please contact our office with your insurance details, and we will verify your coverage for you.
 </p>
 </details>
 
 <details class=&quot;group rounded-2xl shadow-sm [&amp;amp;_summary::-webkit-details-marker]:hidden open:ring-1 open:ring-emerald-500/20 bg-white&quot;>
 <summary class=&quot;flex cursor-pointer items-center justify-between gap-1.5 p-6 text-slate-900&quot;>
 <h2 class=&quot;text-lg font-semibold&quot;>How often should I get a check-up?</h2>
 <div class=&quot;rounded-full p-1.5 text-emerald-500 transition duration-300 group-open:-rotate-180 bg-emerald-50&quot;>
 <svg xmlns=http://www.w3.org/2000/svg width=24 height=24 viewBox=&quot;0 0 24 24&quot; fill=none stroke=currentColor stroke-width=2 stroke-linecap=round stroke-linejoin=round data-lucide=chevron-down class=&quot;lucide lucide-chevron-down w-5 h-5&quot;><path d=&quot;m6 9 6 6 6-6&quot;></path></svg>
 </div>
 </summary>
 <p class=&quot;px-6 pb-6 text-slate-500 leading-relaxed font-medium&quot;>
 We recommend visiting the dentist every six months for a routine check-up and cleaning to maintain optimal oral health.
 </p>
 </details>
 
 <details class=&quot;group rounded-2xl shadow-sm [&amp;amp;_summary::-webkit-details-marker]:hidden open:ring-1 open:ring-emerald-500/20 bg-white&quot;>
 <summary class=&quot;flex cursor-pointer items-center justify-between gap-1.5 p-6 text-slate-900&quot;>
 <h2 class=&quot;text-lg font-semibold&quot;>Do you offer emergency appointments?</h2>
 <div class=&quot;rounded-full p-1.5 text-emerald-500 transition duration-300 group-open:-rotate-180 bg-emerald-50&quot;>
 <svg xmlns=http://www.w3.org/2000/svg width=24 height=24 viewBox=&quot;0 0 24 24&quot; fill=none stroke=currentColor stroke-width=2 stroke-linecap=round stroke-linejoin=round data-lucide=chevron-down class=&quot;lucide lucide-chevron-down w-5 h-5&quot;><path d=&quot;m6 9 6 6 6-6&quot;></path></svg>
 </div>
 </summary>
 <p class=&quot;px-6 pb-6 text-slate-500 leading-relaxed font-medium&quot;>
 Yes, we set aside time each day for dental emergencies. Please call us immediately if you are experiencing pain or have a dental injury.
 </p>
 </details>
 
 <details class=&quot;group rounded-2xl shadow-sm [&amp;amp;_summary::-webkit-details-marker]:hidden open:ring-1 open:ring-emerald-500/20 bg-white&quot;>
 <summary class=&quot;flex cursor-pointer items-center justify-between gap-1.5 p-6 text-slate-900&quot;>
 <h2 class=&quot;text-lg font-semibold&quot;>Do you offer cosmetic dentistry?</h2>
 <div class=&quot;rounded-full p-1.5 text-emerald-500 transition duration-300 group-open:-rotate-180 bg-emerald-50&quot;>
 <svg xmlns=http://www.w3.org/2000/svg width=24 height=24 viewBox=&quot;0 0 24 24&quot; fill=none stroke=currentColor stroke-width=2 stroke-linecap=round stroke-linejoin=round data-lucide=chevron-down class=&quot;lucide lucide-chevron-down w-5 h-5&quot;><path d=&quot;m6 9 6 6 6-6&quot;></path></svg>
 </div>
 </summary>
 <p class=&quot;px-6 pb-6 text-slate-500 leading-relaxed font-medium&quot;>
 Absolutely. We offer veneers, teeth whitening, bonding, and full smile makeovers to help you achieve the confident smile you desire.
 </p>
 </details>
 
 <details class=&quot;group rounded-2xl shadow-sm [&amp;amp;_summary::-webkit-details-marker]:hidden open:ring-1 open:ring-emerald-500/20 bg-white&quot;>
 <summary class=&quot;flex cursor-pointer items-center justify-between gap-1.5 p-6 text-slate-900&quot;>
 <h2 class=&quot;text-lg font-semibold&quot;>Can I book my appointment online?</h2>
 <div class=&quot;rounded-full p-1.5 text-emerald-500 transition duration-300 group-open:-rotate-180 bg-emerald-50&quot;>
 <svg xmlns=http://www.w3.org/2000/svg width=24 height=24 viewBox=&quot;0 0 24 24&quot; fill=none stroke=currentColor stroke-width=2 stroke-linecap=round stroke-linejoin=round data-lucide=chevron-down class=&quot;lucide lucide-chevron-down w-5 h-5&quot;><path d=&quot;m6 9 6 6 6-6&quot;></path></svg>
 </div>
 </summary>
 <p class=&quot;px-6 pb-6 text-slate-500 leading-relaxed font-medium&quot;>
